import React, { Fragment } from "react";
import Headers from "../Header/header";
import Search from "../Search/search";
import Food from "../Food/foods"

import Footer from "../Footer/footer";

const Home = () => {
  return (
    <Fragment>
      <Headers />

      <Search />
      <Food />
      <Footer />
    </Fragment>
  );
};

export default Home;
